        boolean localClass = aClass.isLocalClass();
        System.out.println(memberClass+" "+synthetic+" "+anonymousClass+" "+localClass);

        Arrays.stream(declaredFields).forEach(item ->{
            System.out.println("---------"+item.getName()+"-----------");
            System.out.println("---------"+item.getType().getSimpleName()+"-----------");
            System.out.println("---------"+item.getType().getName()+"-----------");
            System.out.println("---------"+item.getType().getTypeName()+"-----------");
            System.out.println("---------"+item.getType().getCanonicalName()+"-----------");
            System.out.println("---------"+item.getClass().getName()+"-----------");
            System.out.println("---------"+item.getClass().getSimpleName()+"-----------");
            System.out.println("---------"+item.getClass().getTypeName()+"-----------");
            System.out.println("---------"+item.getClass().getCanonicalName()+"-----------");
            Class<?> type = item.getType();
            Class<? extends Field> aClass1 = item.getClass();
            System.out.println(aClass1.isMemberClass());
            System.out.println(type.isMemberClass());
            System.out.println(type.isSynthetic());
            System.out.println(type.isAnonymousClass());
            System.out.println(type.isLocalClass());
        });



